import React, { Component } from "react";
import Questions from '../Questions/Questions'
import Procedure from '../Procedure/Procedure'
import './Home.css';

import { initDatabase } from "../Helpers";

class Home extends Component {

  constructor(props) {
    super(props);
    this.startTime = 0;
    this.db = null;
  }

  componentDidMount() {
    this.db = initDatabase();
  }

  render() {

    return (
      <div>
        {/* Left pane (Procedure section) */}
        <div className="bg-dark split left">
          <div>
            <Procedure db={this.db} startTime={this.startTime}></Procedure>
          </div>
        </div>

        {/* Right pane (Questions sections) */}
        <div className="bg-light split right">
          <div>
            <Questions db={this.db} startTime={this.startTime}></Questions>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
